import React from "react";
import './upperbody.css'
import upperbodyimg from '../assets/images/proposedHomePage.png'

export default function UpperBody() {
    let upperbodyStyle = {
        margin: '0px',
        position: "absolute",
        width: "100%",
        height: '50vh',
}
    return(
        <div style={upperbodyStyle} >
            <h1>UpperBody</h1>
            <img src={upperbodyimg}></img>
        </div>
    )
}
